import * as React from 'react';
import Box from '@mui/material/Box';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import { FixedSizeList } from 'react-window';

function renderRow({songs,index, style}) {

console.log(style)

  return (
    <ListItem style={style} key={index} component="div" disablePadding>
      <ListItemButton>
        {songs.map((song)=>{
           <>
             <ListItemText primary={`${index + 1}`} />
             <ListItemText primary={`img ${index + 1}`} />
             <ListItemText className='song' primary={`${song.name}`} />
             <ListItemText primary={`Author: ${index + 1}`} />
           </>
        })}

      </ListItemButton>
    </ListItem>
  );
}

export default function Live({songs}) {

  return (

    <Box
      sx={{ width: '100%', height: 400, maxWidth: 400, bgcolor: 'background.paper' }}
    >
      <FixedSizeList
        height={400}
        width={500}
        itemSize={60}
        itemCount={8}
        overscanCount={5}
      >  
        {({ index, style }) => renderRow({ index, style, songs })}
      </FixedSizeList>
    </Box>
  );
}
